import React from "react";
import Foo from "./Foo";
import Bar from "./Bar";

const Components = {
  foo: Foo,
  bar: Bar
};

export default block => {
  console.log('-----', block.component);
  if (typeof Components[block.component] !== "undefined") {
    return React.createElement(Components[block.component], {
      key: block._uid,
      block: block
    });
  }
